import React from 'react';

const selectBox = (props) => {
        const {type} = props;
      return (
            <select onChange = {() => props.updatePersonHandler(event,type,props.identifier)} disabled = {props.disabledInfo}>
					{props.optionsData.map(v => <option key = {props.identifier +v}  value = {v} selected = {props.selectedVal == v ? "selected" : ""} >{v}</option>)}
				</select>
      );
  }

  export default selectBox;
